import React,{useState,useEffect} from "react";
import axios, { Axios } from "axios";
import { useNavigate } from "react-router-dom";
import { useParams } from "react-router-dom";
//const id='';

function EditCoopSchedule()
{
    const navigate = useNavigate();

    const CoopSchedule = () => 
    {
        let coop_schedule_id = useParams();
        return(coop_schedule_id);
    };

    console.log(CoopSchedule());

    const get_a_coop_schedule = async(e) => {
        //e.preventDefault();
        const data = CoopSchedule();
        console.log(data);
        await axios.post('http://localhost:8080/student_coop_schedule',data )
            .then(res=>
            {
                console.log(res.data);
               // setSchedule(res.data);
            })
            .catch(error => {
                //setErrorMessage("No Co-op Schedule found!");
            })
    }

    //get_a_coop_schedule();

    return(
        <div>
            <h1>Edit Your Coop Schedule</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Weekday</th>
                            <th>Subject</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>AAA</td>
                            <td>BBB</td>
                            <td>CCC</td>
                        </tr>
                    </tbody>
                </table>
        </div>
    )
}

export default EditCoopSchedule;
